import "./Button.css";
import { Link } from "react-router-dom";
import React, { useState } from "react";

export function Button() {
	const [click, setClick] = useState(false);

	return (
		<Link to="/Menu">
			<button className="btn">Get Quote</button>
		</Link>
	);
}
